just had a sip in the far past but never really got to get it so that it seems as if everyone on the planet has had at least 4 bottles of it and I have not. Well this is one of those. I am sure many of you have the same with many other bottles as well. But then again: What would life be with an empty gin wish list?! Exactly, a dull and boring thing to bare.\n\nAbsolutely looking forward to trying it this one I can probably rely on many great serving suggestions by you dear all-knowing ginstagram. Let me know your favourite combo for the @berlinerbrandstifter and/or a typical gin you feel everyone has tried only you have not. So excited to read your recommendations and wish list entries.\n\nCheers and Ginsalabim \ud83c\udf78\n\nNot a paid promotion but a free sample by the producer without any obligations. Marked as advertising due to links to the producer's profile.\n\n#gin #tonic #gintonic #gingingin #ginsalabim #ginstagram #hamburg #drinkresponsibly #longdrink #cocktail #ginlover #cheers #juniper #ginlove #tonicwater #review #advertising #werbung #berlin #berlinerbrandstifter #cucumber #waldmeister #elderflower #mailtime #thisjustin #hauptstadtgin #berlinstagram #berlinstyle #germangin\"}}]},\"shortcode\":\"BneZ1augh1b\",\"edge_media_to_comment\":{\"count\":1},\"taken_at_timestamp\":1536431015,\"dimensions\":{\"height\":1080,\"width\":1080},\"display_url\":\"https://instagram.fham2-1.fna.fbcdn.net/vp/c65d3d177015412532aa1ece6917a2fe/5C34DFA2/t51.2885-15/e35/40813926_515382518885376_2487180670802812551_n.jpg\",\"edge_liked_by\":{\"count\":11},\"edge_media_preview_like\":{\"count\":11},\"owner\":{\"id\":\"3542036120\"},\"thumbnail_src\":\"https://instagram.fham2-1.fna.fbcdn.net/vp/b26d73a8adf46bfec45574760598d389/5C248647/t51.2885-15/sh0.08/e35/s640x640/40813926_515382518885376_2487180670802812551_n.jpg\",\"thumbnail_resources\":[{\"src\":\"https://instagram.fham2-1.fna.fbcdn.net/vp/fc28e5ad4febb3b6ce1dbd8422850846/5C3931E0/t51.2885-15/e35/s150x150/40813926_51538251