            {
                LimitExplorePages = 1,
                LimitImagePages   = 1,
                LimitUserPages    = 1,
                MaxHashtagLength  = 30,
                MinHashtagLength  = 5
            };
            this.crawler = new CrawlerV4(this.requestHandler, settings);
            this.crawler.OnHashtagNamesFound += this.OnHashtagNamesFound;
            this.crawler.OnHashtagFoundComplete += this.OnHashtagFoundComplete;
            this.crawler.OnImageFound += this.OnImageFound;

            this.tags = new List<IHumanoidTag>();
            this.tagNames = new List<string>();
